import "./Card.css";

function Card(props) {
  // class를 변수화에서
  const classes = "card " + props.className;
  // children
  // A 컴포넌트 사이에 B 컴포넌트가 있을 때, A 컴포넌트에서 B 컴포넌트 내용을 보여줌
  return <div className={classes}>{props.children}</div>;
}
export default Card;
